  }

  @media (min-width: 800px) {
    align-items: center;
    left: 0;
  }

  @media (min-width: 1200px) {
    padding: 1em 0;
  }

  &__logo {
    color: variables.$yellow;
    font-family: variables.$anton;
    font-size: 3rem;
    margin-top: 0.3em;
    margin-left: 1em;

    @media (min-width: 800px) {
      margin-top: 0;
      margin-left: 2em;
    }
  }

  &__list {
    background-color: white;
    padding-bottom: 1em;
    position: absolute;
    width: 70%;
    height: 100vh;
    top: 0;
    left: -70%;
    transition: all 0.3s ease-in;
    @media (min-width: 800px) {
      background-color: transparent;
      position: relative;
      width: auto;
      padding-bottom: 0;
      margin-right: 3em;
      left: unset;
      height: auto;
      display: flex;
      transition: none;
    }

    div {
      width: 100%;
      height: 4em;
      background-color: variables.$yellow;
      margin-bottom: 2em;

      @media (min-width: 800px) {
        display: none;
      }
    }

    li {
      position: relative;
      margin: 2em 0;
      text-align: left;
      z-index: 1;
      color: white;

      @media (min-width: 800px) {
        transition: all 0.2s cubic-bezier(0.77, 0, 0.175, 1);
        margin: 0;
      }
      a {
        width: 80%;
        padding-top: 0.5em;
        padding-bottom: 0.5em;
        padding-left: 1em;
        padding-right: 1em;
        text-decoration: none;
        color: black;
        font-weight: 300;

        @media (min-width: 800px) {
          color: variables.$white;

          span {
            display: none;
          }
        }
      }
    }
  }

  &__checkbox {
    background-color: rgb(150, 150, 150);
    width: 3em;
    height: 3em;
    position: absolute;
    top: 0.5em;
    right: 0;
    transform: translateX(-50%);
    z-index: 2;
    opacity: 0;
    cursor: pointer;

    @media (min-width: 800px) {
      display: none;
    }

    &:checked {
      background-color: variables.$white;

      & + .nav__hamburger {
        > div {
          transform: rotate(225deg);
          &::before,
          &::after {
            top: 0;
            transform: rotate(90deg);
          }

          &::after {
            opacity: 0;
          }
        }
      }

      & ~ .nav__list {
        transform: translateX(100%);
      }
    }
  }

  &__hamburger {
    width: 2.5em;
    height: 2em;
    right: 0;
    margin-top: 0.5em;
    transform: translateX(-50%);
    display: flex;
    flex-direction: column;
    justify-content: center;
    @media (min-width: 800px) {
      display: none;
    }

    > div {
      position: relative;
      background-color: variables.$white;
      height: 0.2em;
      transition: all 0.3s ease-in;

      &::before,
      &::after {
        content: '';
        position: absolute;
        top: -0.7em;
        left: 0;
        width: 100%;
        height: 0.2em;
        background-color: variables.$white;
        transition: all 0.3s ease-in;
      }

      &::after {
        top: 0.7em;
      }
    }
  }
}

