      width: 100%;

      &__box {
        position: relative;
        width: 100%;
        margin-bottom: 2.5em;
        display: flex;
        justify-content: center;

        input,
        textarea {
          display: block;
          border: 1px solid #b4b4b4;
          width: 100%;
          padding: 1em;
          font-size: 1.5rem;
        }

        input:focus,
        textarea:focus {
          outline: none;
          border-color: variables.$yellow;
        }

        label {
          position: absolute;
          pointer-events: none;
          left: 0.8em;
          top: 50%;
          transform: translateY(-50%);
          transition: all 0.5s ease;
        }

        textarea {
          width: 100%;
        }

        input:focus + label,
        input:valid + label {
          opacity: 0.5;
          top: -40%;
        }

        textarea:focus + label,
        textarea:valid + label {
          top: -20%;

          @media (min-width: 600px) {
            top: -15%;
          }
        }
      }

